import React, { Component } from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

class AutoLayoutExample extends Component {
  render() {
    return (
      <Container className='d-flex justify-content-center align-items-center'>
        <Row className="w-100">
          <Col xs={12} className="w-100" id='column-1'>
            <h1 className='fs-1 text-white m-3 text-capitalize fw-normal'>Our Mission</h1>
            <p className='m-3 text-white'>
              Non veritatis tempor elementum integer? Ridiculus aspernatur debitis habitant fusce, egestas fuga maecenas!
              Rerum vel mauris illo eveniet, viverra doloribus, minima velit magnam justo et.
            </p>
          </Col>

          {/* Second Column */}
          <Col xs={12} sm={4} className="w-100" id='column-2'>
            <h1 className='fs-1 text-white m-3 text-capitalize fw-normal'>Our Vision</h1>
            <p className='m-3 text-white'>
              Omnis porta diamlorem quas donec placerat. Torquent modi donec nullam, odio elit error, quos tortor facere?
              Vero, nihil faucibus tincidunt. Placeat nisl earum molestias porta.
            </p>
          </Col>
          <Col xs={12} sm={4} className="w-100" id='column-3'>
            <h1 className='fs-1 m-3 text-white text-capitalize fw-normal'>Core Values</h1>
            <p className='text-white m-3'>
              Omnis porta diamlorem quas donec placerat. Torquent modi donec nullam, odio elit error, quos tortor facere?
              Vero, nihil faucibus tincidunt. Placeat nisl earum molestias porta.
            </p>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default AutoLayoutExample;
